def getLayer(chan):
  layer = -2
  #slabs
  if(chan == 18): layer = 0
  if(chan == 20): layer = 0
  if(chan == 28): layer = 0
  if(chan == 21): layer = 0

  #layer 1 bars
  if(chan == 0): layer = 1
  if(chan == 1): layer = 1
  if(chan == 24): layer = 1
  if(chan == 25): layer = 1
  if(chan == 8): layer = 1
  if(chan == 9): layer = 1
  #layer 1 sheets
  if(chan == 29): layer = 1
  if(chan == 10): layer = 1
  if(chan == 27): layer = 1

  #layer 2 bars
  if(chan == 6): layer = 2
  if(chan == 7): layer = 2
  if(chan == 16): layer = 2
  if(chan == 17): layer = 2
  if(chan == 12): layer = 2
  if(chan == 13): layer = 2
  #layer 2 sheets
  if(chan == 19): layer = 2
  if(chan == 11): layer = 2
  if(chan == 30): layer = 2

  #layer 3 bars
  if(chan == 2): layer = 3
  if(chan == 3): layer = 3
  if(chan == 22): layer = 3
  if(chan == 23): layer = 3
  if(chan == 4): layer = 3
  if(chan == 5): layer = 3
  #layer 3 sheets
  if(chan == 14): layer = 3
  if(chan == 26): layer = 3
  if(chan == 31): layer = 3

  if(layer == -2):
    print ("Not a valid channel")

  return layer


