def convertPhysChToCoord(phys_ch):

    # unit = cm
    space_btw_packs = 1
    space_btw_bars  = 0.2

    phys_ch_x = phys_ch[0]
    phys_ch_y = phys_ch[1]
    phys_ch_z = phys_ch[2]

    x=-999
    y=-999
    z=-999
    ex=-999
    ey=-999
    ez=-999
  
    # vertical: y=0
    if(phys_ch_y==0):
    
        # bottom: z>0
        if(phys_ch_z>0):
            # x
            if(phys_ch_x>0): x = space_btw_packs/2 + 2./2 + (phys_ch_x-1)*2. + (phys_ch_x-1)*0.2
            else: x = -1*space_btw_packs/2 - 2./2 + (phys_ch_x+1)*2. + (phys_ch_x+1)*0.2
            # z
            z = 180 + 0.5 +  (phys_ch_z-1)*2. + 2./2 + (phys_ch_z-1)*0.2
            # y: approximate
            y=0

        # top: z<0
        else:
            # x
            if(phys_ch_x>0): x = space_btw_packs/2 + 2./2 + (phys_ch_x-1)*2. + (phys_ch_x-1)*0.2
            else: x = -1*space_btw_packs/2 - 2./2 + (phys_ch_x+1)*2. + (phys_ch_x+1)*0.2
            # z
            z = -180 - 10 - 0.5 + (1+phys_ch_z)*2. - 2./2 + (1+phys_ch_z)*0.2
            # y
            y=0

        #ex = TMath::Sqrt(2.*2./12.)
        #ey = TMath::Sqrt(45.*45./12.)
        #ez = TMath::Sqrt(2.*2./12.)
        ex = math.sqrt(0.2*0.2/12.)
        ey = math.sqrt(45.*45./12.)
        ez = math.sqrt(0.2*0.2/12.)

    # horizontal: x=0
    if(phys_ch_x==0):
        # y
        if(phys_ch_y<5): y = -1.25 + (phys_ch_y-1)*2. + (phys_ch_y-1)*0.2
        else: y = -1.25 + (phys_ch_y-1)*2. + (phys_ch_y-1)*0.2+0.8

        # bottom: z>0
        if(phys_ch_z>0):
            z = 180 - (2-phys_ch_z)*2. - 2./2 - (2-phys_ch_z)*0.2

        # top: z<0
        else:
            z = -180 - 5 + (phys_ch_z+1)*2. - 2./2 + (phys_ch_z+1)*0.2

        x=0
        #ex = TMath::Sqrt(45.*45./12.)
        #ey = TMath::Sqrt(2.*2./12.)
        #ez = TMath::Sqrt(2.*2./12.)
        ex = math.sqrt(45.*45./12.)
        ey = math.sqrt(0.2*0.2/12.)
        ez = math.sqrt(0.2*0.2/12.)
    
    coord_vec = []
    coord_vec.append(x)
    coord_vec.append(y)
    coord_vec.append(z)
    # uncertainty
    # note that the variance of a flat distribution is l^2/12 where l is the width
    coord_vec.append(ex)
    coord_vec.append(ey)
    coord_vec.append(ez)
    return coord_vec

def convertBarChToPhysCoord(barCh):
    row3 = [0,1,6,7,2,3]
    row2 = [24,25, 16,17, 22,23]
    row1 = [8,9,12,13,4,5]

    x=-999
    y=-999
    if barCh in row1:
        y = 0
    elif barCh in row2:
        y = 6
    elif barCh in row3:
        y = 12
    if barCh % 2 == 0:
        x = -3
    else:
        x = 3
    if x == -999 or y == -999:
        return
    coords = [x,y]
    return coords

def displayProgress(i, entries):
    div = float(entries-1)/100
    it = 0 
    if div != 0:
        it = int(i/div)
    sys.stdout.write(Fore.CYAN+"\r["+str(it)+"%]"+Style.RESET_ALL)
    sys.stdout.flush()

    
def calcIntervalErrors(hPassArg, hTotalArg):
    r.TH1F.SetDefaultSumw2()

    hPass = hPassArg
    hTotal = hTotalArg
    effGraph = r.TGraphAsymmErrors(hPass, hTotal)
    errorBounds = [effGraph.GetErrorYlow(0),effGraph.GetErrorYhigh(0)]
    
    return errorBounds

def propagatePoissErrors(a,b):
    error = math.sqrt(( a/ math.pow(b,2))   + (math.pow(a,2)/math.pow(b,3) ) )
    return  error

